import React, { useEffect } from "react";
import axios from "axios";
export default function Test() {
	useEffect(() => {
		axios
			.get(
				`https://pixabay.com/api/?key=16381049-c197cfa5caeabac8c93d8da2c&q=yellow+flowers&image_type=photo&pretty=true`
			)
			.then((res) => {
				console.log(res);
			})
			.catch((err) => console.log(err));
	}, []);
	return <div></div>;
}
